import React, { Component } from "react";
import "./App.css";

class Voting extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <nav class="navbar navbar-light bg-light">
          <span class="navbar-brand mb-0 h1">Widget App Marian Kowall</span>
        </nav>
      </div>
    );
  }
}
export default Voting;
